import{_ as i,r,o as n,c,a as e,b as a,w as l,e as t,d as o}from"./app.41cb161e.js";const h="/assets/barcodes/barcode_36.png",p="/assets/barcodes/barcode_37.png",u="/assets/barcodes/barcode_38.png",m="/assets/barcodes/4-state.png",b="/assets/barcodes/barcode_39.png",g="/assets/barcodes/barcode_40.png",_="/assets/barcodes/barcode_41.png",f="/assets/barcodes/mailmark.png",y="/assets/barcodes/barcode_42.png",P="/assets/barcodes/barcode_43.png",k={},w=e("h1",{id:"two-track-symbols",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#two-track-symbols","aria-hidden":"true"},"#"),t(" Two-Track symbols")],-1),A=o('<h2 id="two-track-pharmacode" tabindex="-1"><a class="header-anchor" href="#two-track-pharmacode" aria-hidden="true">#</a> Two-Track Pharmacode</h2><p><img src="'+h+'" alt="Pharmacode"></p><p>Developed by Laetus, Pharmacode Two-Track is an alternative system to Pharmacode One-Track used for the identification of pharmaceuticals. The symbology is able to encode whole numbers between <code>4</code> and <code>64570080</code>.</p><h2 id="postnet" tabindex="-1"><a class="header-anchor" href="#postnet" aria-hidden="true">#</a> PostNet</h2><p><img src="'+p+'" alt="PostNet"></p><p>Used by the United States Postal Service until 2009, the PostNet barcode was used for encoding zip-codes on mail items. PostNet uses numerical input data and includes a modulo-10 check digit.</p><p>While any length of PostNet symbols may be encoded, standard lengths as used by USPS were <strong>PostNet6</strong> (5 digits ZIP input), <strong>PostNet10</strong> (5 digit ZIP + 4 digit user data) and <strong>PostNet12</strong> (5 digit ZIP + 6 digit user data).</p><h2 id="planet" tabindex="-1"><a class="header-anchor" href="#planet" aria-hidden="true">#</a> PLANET</h2><p><img src="'+u+'" alt="PLANET"></p><p>Used by the United States Postal Service until 2009, the PLANET (Postal Alpha Numeric Encoding Technique) barcode was used for encoding routing data on mail items.</p><p>Planet uses numerical input data and includes a modulo-10 check digit. While any length of PLANET symbols may be encoded, standard lengths used by USPS were <strong>Planet12</strong> (11 digit input) and <strong>Planet14</strong> (13 digit input).</p><h2 id="_4-state-postal-codes" tabindex="-1"><a class="header-anchor" href="#_4-state-postal-codes" aria-hidden="true">#</a> 4-State Postal Codes</h2><p><img src="'+m+'" alt="4-State barcode"></p><p>4-State barcode systems are comprised of a series of bars, each of which can individually have one of four possible states, to encode information used in automated sortation and delivery onto each piece of mail. Each bar can either be short and centred (known as a <strong>tracker</strong>), medium and elevated (an <strong>ascender</strong>), medium and lowered (a <strong>descender</strong>), or full height.</p><h2 id="australia-post-4-state-symbols" tabindex="-1"><a class="header-anchor" href="#australia-post-4-state-symbols" aria-hidden="true">#</a> Australia Post 4-State symbols</h2><h3 id="customer-barcodes" tabindex="-1"><a class="header-anchor" href="#customer-barcodes" aria-hidden="true">#</a> Customer Barcodes</h3><p><img src="'+b+'" alt="Australia Post symbol"></p>',17),C={href:"https://en.wikipedia.org/wiki/Delivery_point#Australia_Post",target:"_blank",rel:"noopener noreferrer"},S=o("<p><strong>Australia Post Standard Customer Barcode</strong>, <strong>Customer Barcode 2</strong> and <strong>Customer Barcode 3</strong> are 37-bar, 52-bar and 67-bar specifications respectively.</p><p>Valid data characters are <code>0-9</code>, <code>A-Z</code>, <code>a-z</code>, space (<code></code>), and hash (<code>#</code>). A Format Control Code (FCC) is automatically added and should not be included in the input data.</p>",2),x={class:"custom-container tip"},v=e("p",{class:"custom-container-title"},"Note",-1),N={href:"https://en.wikipedia.org/wiki/Reed-Solomon_error_correction",target:"_blank",rel:"noopener noreferrer"},R=o('<h4 id="encoding" tabindex="-1"><a class="header-anchor" href="#encoding" aria-hidden="true">#</a> Encoding</h4><p>Encoding behaviour is determined by the length of the input data according to the formula shown in the following table:</p><table><thead><tr><th>Input Length</th><th>Required Input Format</th><th>symbol Length</th><th>FCC</th><th>Encoding Table</th></tr></thead><tbody><tr><td>8</td><td><code>99999999</code></td><td>37-bar</td><td>11</td><td>None</td></tr><tr><td>13</td><td><code>99999999AAAAA</code></td><td>52-bar</td><td>59</td><td>C</td></tr><tr><td>16</td><td><code>9999999999999999</code></td><td>52-bar</td><td>59</td><td>N</td></tr><tr><td>18</td><td><code>99999999AAAAAAAAAA</code></td><td>67-bar</td><td>62</td><td>C</td></tr><tr><td>23</td><td><code>99999999999999999999999</code></td><td>67-bar</td><td>62</td><td>N</td></tr></tbody></table><h3 id="reply-paid-barcode" tabindex="-1"><a class="header-anchor" href="#reply-paid-barcode" aria-hidden="true">#</a> Reply Paid Barcode</h3><p>A Reply Paid version of the Australia Post 4-State Barcode (FCC 45) which requires an 8-digit DPID input.</p><h3 id="routing-barcode" tabindex="-1"><a class="header-anchor" href="#routing-barcode" aria-hidden="true">#</a> Routing Barcode</h3><p>A Routing version of the Australia Post 4-State Barcode (FCC 87) which requires an 8-digit DPID input.</p><h3 id="redirect-barcode" tabindex="-1"><a class="header-anchor" href="#redirect-barcode" aria-hidden="true">#</a> Redirect Barcode</h3><p>A Redirection version of the Australia Post 4-State Barcode (FCC 92) which requires an 8-digit DPID input.</p><h2 id="dutch-post-kix-code" tabindex="-1"><a class="header-anchor" href="#dutch-post-kix-code" aria-hidden="true">#</a> Dutch Post KIX Code</h2><p><img src="'+g+'" alt="Dutch Post KIX Code"></p><p>This symbology is used by Royal Dutch TPG Post (Netherlands) for Postal code and automatic mail sorting. Data input can consist of numbers <code>0-9</code> and letters <code>A-Z</code>, and must be exactly 11 characters in length. No check digit is included.</p><h2 id="royal-mail-4-state-country-code-rm4scc" tabindex="-1"><a class="header-anchor" href="#royal-mail-4-state-country-code-rm4scc" aria-hidden="true">#</a> Royal Mail 4-State Country Code (RM4SCC)</h2><p><img src="'+_+'" alt="Royal Mail 4-State Code"></p><p>The RM4SCC standard is used by the Royal Mail in the UK to encode postcode and customer data on mail items. Data input can consist of numbers <code>0-9</code> and letters <code>A-Z</code> and usually includes delivery postcode followed by house number. Check digit data is automatically computed.</p><h2 id="royal-mail-4-state-mailmark" tabindex="-1"><a class="header-anchor" href="#royal-mail-4-state-mailmark" aria-hidden="true">#</a> Royal Mail 4-State Mailmark</h2><p><img src="'+f+'" alt="barcode"></p><p>Developed in 2014 as a replacement for <a href="#royal-mail-4-state-country-code-rm4scc">RM4SCC</a>. Input is a pre-formatted alpanumeric string of 22 (for Barcode C) or 26 (for Barcode L) characters, producing a symbol with 66 or 78 bars respectively.</p>',18),T={class:"custom-container tip"},D=e("p",{class:"custom-container-title"},"Note",-1),I={href:"https://en.wikipedia.org/wiki/Reed-Solomon_error_correction",target:"_blank",rel:"noopener noreferrer"},B=o('<h2 id="usps-onecode" tabindex="-1"><a class="header-anchor" href="#usps-onecode" aria-hidden="true">#</a> USPS OneCode</h2><p><img src="'+y+'" alt="USPS OneCode"></p><p>Also known as the <strong>Intelligent Mail Barcode</strong> and used in the US by the United States Postal Service (USPS), this system replaced the <a href="#postnet">PostNet</a> and <a href="#planet">PLANET</a> symbologies in 2009. OneCode is a fixed length (65-bar) symbol which combines routing and customer information in a single symbol.</p><p>Input data consists of a 20 digit tracking code, followed by a dash (<code>-</code>), followed by a delivery point zip-code which can be 0, 5, 9 or 11 digits in length. For example all of the following inputs are valid data entries:</p><h3 id="examples" tabindex="-1"><a class="header-anchor" href="#examples" aria-hidden="true">#</a> Examples</h3><ul><li><code>01234567094987654321</code></li><li><code>01234567094987654321-01234</code></li><li><code>01234567094987654321-012345678</code></li><li><code>01234567094987654321-01234567891</code></li></ul><h2 id="japanese-postal-code" tabindex="-1"><a class="header-anchor" href="#japanese-postal-code" aria-hidden="true">#</a> Japanese Postal Code</h2><p><img src="'+P+'" alt="Japanese Postal Code"></p><p>Used for address data on mail items for Japan Post. Accepted values are <code>0-9</code>, <code>A-Z</code> and dash (<code>-</code>). A modulo-19 check digit is automatically added.</p>',9);function E(L,U){const s=r("RouterLink"),d=r("ExternalLinkIcon");return n(),c("div",null,[w,e("p",null,[a(s,{to:"/reference/#two-track-symbologies"},{default:l(()=>[t("Click here")]),_:1}),t(" for a condensed list of two-track symbologies.")]),A,e("p",null,[t("This symbology was developed by Australia Post for printing "),e("a",C,[t("Delivery Point ID (DPID)"),a(d)]),t(" and customer information on mail items.")]),S,e("div",x,[v,e("p",null,[e("a",N,[t("Reed-Solomon error correction"),a(d)]),t(" data is automatically computed.")])]),R,e("div",T,[D,e("p",null,[e("a",I,[t("Reed-Solomon error correction"),a(d)]),t(" data is automatically computed.")])]),B])}const F=i(k,[["render",E],["__file","two-track.html.vue"]]);export{F as default};
